  false,\n\t\"url\": null,\n\t\"notes\": \"The CLIMAP (Climate: Long-range Investigation,
  Mapping,n               andPrediction) Project was funded by the National Science
  Foundation aspart of then               International Decade of Ocean Exploration
  (IDOE) Program. The CLIMAP 18k bp sedimentn               data files were compiled
  by Oregon State University, and include the work of severaln               major
  institutions. The files contain micropaleontology in the form of faunal countsn
  \              of diatoms, planktonic foraminifera, coccoliths, and radiolaria,
  as well asn               stratigraphy (percent fine, coarse, total carbonate, oxygen
  18 and carbon 13), andn               geochemistry (percent opal, quartz, and organic
  carbon), and inferred sea surfacen               temperatures for 635 ocean sediment
  cores. Data are primarily from the period 18,000n               years bp to the
  present. Time data give upper and lower samples depths, technique,n               and
  C14 dates (for total sample, coarse fraction, and fine fraction). Age estimatesn
  \              are given in thousands of years with upper and lower age error estimates.
  Inn               addition, each data records contains station information. The
  CLIMAP 18k data set isn               available for direct download as a Paleoclimatology
  data set from the NOAA National Centers n               for Environmental Information
  (NCEI) and collocated World Data Center for Paleoclimatrology.\",\n\t\"license_title\":
